##################### IntakeExitBirthDeath(2species)

@export function IEBDBD(;  
                            kI=10., kE=0.1, 
                            kb=10.0, kd=0.1, 
                            λ=100.0, 
                            Ω=1.0, Ωc=1.0,
                            )
    kI, kE, kb, kd, λ, Ω, Ωc = float.( (kI, kE, kb, kd, λ, Ω, Ωc) )
    kI *= Ω
    kb *= Ωc
    p = Dict(:kI=>kI, :kE=>kE, :kb=>kb, :kd=>kd, :λ=>λ, 
                :Ω=>Ω, :Ωc=>Ωc,
                )
    ssaSys = getIEBDBDSSASystem(; kI=kI, kE=kE, kb=kb, kd=kd, λ=λ)
    # labelsOde = [:N, :N2, :M¹⁰, :M¹⁰2, :M⁰¹, :M⁰¹2, :M¹¹, :NM⁰¹, :NM¹⁰]
    labelsOde = [:N, :N2, :M¹⁰, :M¹⁰2, :M⁰¹, :M⁰¹2, :M¹¹, :M²⁰, :M⁰², :NM¹⁰, :NM⁰¹]
    momentsMapping = MomentsMap(labelsOde)
    sigmaMapping = SigmaMap([:N, :M¹⁰, :M⁰¹])
    @show sigmaMapping #debug
    # return Model(p, Ω, Ωc, IEBDBD_initial_2, IEBDBD_ODEs_2, ssaSys,
    return Model(p, Ω, Ωc, IEBDBD_initial_2, IEBDBD_ODEs_3, ssaSys,
                    momentsMapping, sigmaMapping)
end

function getIEBDBDSSASystem(;
                            kI = 0.0, kE = 0.0,  # Intake/Exit rates for cells
                            kb = 0.0, kd = 0.0,  # Birth/Death rates for X1
                            λ = 0,  # Parameter of the poisson distrib on intake
                            )
    S = Sim.System("IEBDBD", 2, # X1, X2
            [:N =>[0,0], # Number of compartments
             :M¹⁰ =>[1,0], # M¹⁰
             :M²⁰ =>[2,0], # M²⁰
             :M⁰¹ =>[0,1], # M⁰¹
             :M⁰² =>[0,2], # M⁰²
             :M¹¹ =>[1,1], # M¹¹
            ]
            )

    # cells' reaction network
    # prodX1 = Sim.new_chemical_reaction_class([1,0], kb)
    prodX1 = Sim.new_chemical_reaction_class([1,1], kb)
    prodX1.H = (n::SystemState, Mom::Moments) -> Mom[1]
    prodX1.fast_sample_reactants! = fast_sample_uniform_cell

    deathX1 = Sim.new_chemical_reaction_class([-1,0], kd)
    deathX1.H = (n::SystemState, Mom::Moments) -> Mom[2]
    deathX1.g = (xc::Compartments, Mom::Moments) -> xc[1][1]

    prodX2 = Sim.new_chemical_reaction_class([0,1], kb)
    prodX2.H = (n::SystemState, Mom::Moments) -> Mom[1]
    prodX2.fast_sample_reactants! = fast_sample_uniform_cell

    deathX2 = Sim.new_chemical_reaction_class([0,-1], kd)
    deathX2.H = (n::SystemState, Mom::Moments) -> Mom[4]
    deathX2.g = (xc::Compartments, Mom::Moments) -> xc[1][2]

    # Compartment reactions
    cellIntake = Sim.TransitionClass(0, 1, kI)
    cellIntake.H = (n::SystemState, Mom::Moments) -> 1
    # This is how the output compartment (yc) of the transition looks like
    cellIntake.pi = function(yc::Compartments, xc::Compartments)
                        yc[1][1] = rand(Poisson(λ))
                        yc[1][2] = rand(Poisson(λ))
                    end
    # cell_division.fast_sample_reactants! = fast_sample_cell_div

    cellExit = Sim.TransitionClass(1, 0, kE) # This is a cell death
    cellExit.H = (n::SystemState, Mom::Moments) -> Mom[1] # Depends on num cells
    cellExit.fast_sample_reactants! = fast_sample_uniform_cell

    # Sim.add_transition_class(S, prodX1, deathX1, prodX2, deathX2, 
    Sim.add_transition_class(S, prodX1, deathX1, deathX2, 
        cellIntake, cellExit)

    return S
end

function IEBDBD_ODEs(dM, M, parameters, t)
    c4 = parameters[:λ] # λ
    c0 = parameters[:kE] # kE
    c2 = parameters[:kI] # kI
    c3 = parameters[:kb] # kb
    c1 = parameters[:kd] # kd
    # Number of Compartments (N)
    dM[1] = c2-c0*M[1]
    # N^2
    dM[2] = c2+c0*M[1]-2*c0*M[2]+2*c2*M[1]
    # Total Mass of species 1
    dM[3] = c4*c2+c3*M[1]-c0*M[3]-c1*M[3]
    # M1^2
    dM[4] = c4*c2+c2*((c4)^(2))+c3*M[1]+c1*M[3]-2*c0*M[4]-2*c1*M[4]+2*c3*M[9]+c0*((M[3])^(2))/M[1]+2*c4*c2*M[3]
    # Total Mass of species 2
    dM[5] = c4*c2+c3*M[1]-c0*M[5]-c1*M[5]
    # M2^2
    dM[6] = c4*c2+c2*((c4)^(2))+c3*M[1]+c1*M[5]-2*c0*M[6]-2*c1*M[6]+2*c3*M[8]+c0*((M[5])^(2))/M[1]+2*c4*c2*M[5]
    # Sum of squared content of species 1
    dM[7] = ((c2*((c4)^(2))+c3*M[5]+c3*M[3])*M[1]-c0*M[5]*M[3]-2*c1*M[5]*M[3])/M[1]
    # N*M2
    dM[8] = c4*c2+c0*M[5]+c2*M[5]+c3*M[2]-c1*M[8]-2*c0*M[8]+c4*c2*M[1]
    # N*M1
    dM[9] = c4*c2+c0*M[3]+c2*M[3]+c3*M[2]-c1*M[9]-2*c0*M[9]+c4*c2*M[1]
    return
end
function IEBDBD_ODEs_2(dM, M, parameters, t)
    c2 = parameters[:λ] # λ
    c0 = parameters[:kE] # kE
    c4 = parameters[:kI] # kI
    c1 = parameters[:kb] # kb
    c3 = parameters[:kd] # kd
    # Number of Compartments (N)
    dM[1] = c4-c0*M[1]
    # N^2
    dM[2] = c4+c0*M[1]-2*c0*M[2]+2*c4*M[1]
    # Total Mass of species 1
    dM[3] = c2*c4+c1*M[1]-c0*M[3]-c3*M[3]
    # M1^2
    dM[4] = c2*c4+c4*((c2)^(2))+c1*M[1]+c3*M[3]-2*c0*M[4]-2*c3*M[4]+2*c1*M[10]+c0*((M[3])^(2))/M[1]+2*c2*c4*M[3]
    # Total Mass of species 2
    dM[5] = c2*c4+c1*M[1]-c0*M[5]-c3*M[5]
    # M2^2
    dM[6] = c2*c4+c4*((c2)^(2))+c1*M[1]+c3*M[5]-2*c0*M[6]-2*c3*M[6]+2*c1*M[11]+c0*((M[5])^(2))/M[1]+2*c2*c4*M[5]
    # Sum of squared content of species 1
    dM[7] = c4*((c2)^(2))+c1*M[5]+c1*M[3]-c0*M[7]-2*c3*M[7]
    # Sum of squared content of species 1
    dM[8] = c2*c4+c4*((c2)^(2))+c1*M[1]+c3*M[3]-c0*M[8]-2*c3*M[8]+2*c1*M[3]
    # Sum of squared content of species 2
    dM[9] = c2*c4+c4*((c2)^(2))+c1*M[1]+c3*M[5]-c0*M[9]-2*c3*M[9]+2*c1*M[5]
    # N*M1
    dM[10] = c2*c4+c0*M[3]+c4*M[3]+c1*M[2]-c3*M[10]-2*c0*M[10]+c2*c4*M[1]
    # N*M2
    dM[11] = c2*c4+c0*M[5]+c4*M[5]+c1*M[2]-c3*M[11]-2*c0*M[11]+c2*c4*M[1]
    return
end
function IEBDBD_ODEs_3(dM, M, parameters, t)
    c2 = parameters[:λ] # λ
    c3 = parameters[:kE] # kE
    c1 = parameters[:kI] # kI
    c4 = parameters[:kb] # kb
    c0 = parameters[:kd] # kd
    # Number of Compartments (N)
    dM[1] = c1-c3*M[1]
    # N^2
    dM[2] = c1+c3*M[1]-2*c3*M[2]+2*c1*M[1]
    # Total Mass of species 1
    dM[3] = c2*c1+c4*M[1]-c3*M[3]-c0*M[3]
    # M1^2
    dM[4] = c2*c1+c1*((c2)^(2))+c4*M[1]+c0*M[3]-2*c3*M[4]-2*c0*M[4]+2*c4*M[10]+c3*((M[3])^(2))/M[1]+2*c2*c1*M[3]
    # Total Mass of species 2
    dM[5] = c2*c1+c4*M[1]-c3*M[5]-c0*M[5]
    # M2^2
    dM[6] = c2*c1+c1*((c2)^(2))+c4*M[1]+c0*M[5]-2*c3*M[6]-2*c0*M[6]+2*c4*M[11]+c3*((M[5])^(2))/M[1]+2*c2*c1*M[5]
    # Sum of squared content of species 1
    dM[7] = c1*((c2)^(2))+c4*M[1]+c4*M[5]+c4*M[3]-c3*M[7]-2*c0*M[7]
    # Sum of squared content of species 1
    dM[8] = c2*c1+c1*((c2)^(2))+c4*M[1]+c0*M[3]-c3*M[8]-2*c0*M[8]+2*c4*M[3]
    # Sum of squared content of species 2
    dM[9] = c2*c1+c1*((c2)^(2))+c4*M[1]+c0*M[5]-c3*M[9]-2*c0*M[9]+2*c4*M[5]
    # N*M1
    dM[10] = c2*c1+c3*M[3]+c1*M[3]+c4*M[2]-c0*M[10]-2*c3*M[10]+c2*c1*M[1]
    # N*M2
    dM[11] = c2*c1+c3*M[5]+c1*M[5]+c4*M[2]-c0*M[11]-2*c3*M[11]+c2*c1*M[1]
    return
end

# initialize expected moments vector
function IEBDBD_initial(N0, Mpc0)
    M0 = N0*Mpc0
    MM0 = N0*Mpc0*Mpc0
    M = zeros(9)
    # Number of Compartments (N)
    M[1] = N0 # initial value for Moment(0, 0), please specify!
    # N^2
    M[2] = ((M[1])^(2))
    # Total Mass of species 1
    M[3] = M0 # initial value for Moment(1, 0), please specify!
    # M1^2
    M[4] = ((M[3])^(2))
    # Total Mass of species 2
    M[5] = M0 # initial value for Moment(0, 1), please specify!
    # M2^2
    M[6] = ((M[5])^(2))
    # Sum of squared content of species 1
    M[7] = MM0 # initial value for Moment(1, 1), please specify!
    # N*M2
    M[8] = M[1]*M[5]
    # N*M1
    M[9] = M[1]*M[3]
    return M
end
function IEBDBD_initial_2(N0, Mpc0)
    M0 = N0*Mpc0
    MM0 = N0*Mpc0*Mpc0
    M = zeros(11)
    # Number of Compartments (N)
    M[1] = N0 # initial value for Moment(0, 0), please specify!
    # N^2
    M[2] = ((M[1])^(2))
    # Total Mass of species 1
    M[3] = M0 # initial value for Moment(1, 0), please specify!
    # M1^2
    M[4] = ((M[3])^(2))
    # Total Mass of species 2
    M[5] = M0 # initial value for Moment(0, 1), please specify!
    # M2^2
    M[6] = ((M[5])^(2))
    # Sum of squared content of species 1
    M[7] = MM0 # initial value for Moment(1, 1), please specify!
    # Sum of squared content of species 1
    M[8] = MM0 # initial value for Moment(2, 0), please specify!
    # Sum of squared content of species 2
    M[9] = MM0 # initial value for Moment(0, 2), please specify!
    # N*M1
    M[10] = M[1]*M[3]
    # N*M2
    M[11] = M[1]*M[5]
    return M
end

##################### IntakeExitCoagulationFragmentation2SpeciesBirthDeath
@export function IECF2BD(;  
                            kI=1.0, kE=0.01, 
                            kC=1e-4, kF=2*5e-7, 
                            kb=0.0, kd=0.0, 
                            # kb=0.0, kd=0.05, 
                            λ=100.0, 
                            Ω=1.0, Ωc=1.0,
                            )
    kI, kE, kC, kF, kb, kd, λ, Ω, Ωc = float.( (kI, kE, kC, kF, kb, kd, λ, Ω, Ωc) )
    kI *= Ω; kC /= Ω
    kb *= Ωc; kF /= Ωc^2
    p = Dict(:kI=>kI, :kE=>kE, :kC=>kC, :kF=>kF, :kb=>kb, :kd=>kd, :λ=>λ, 
                :Ω=>Ω, :Ωc=>Ωc,
                )
    ssaSys = getIECF2BDSSASystem(; kI=kI, kE=kE, kC=kC, kF=kF, kb=kb, kd=kd, λ=λ)
    labelsOde = [:N, :N2, :M¹⁰, :M¹⁰2, :M⁰¹, :M⁰¹2, :M¹¹, :M²⁰, :M⁰², :NM⁰¹, :NM¹⁰, :M¹⁰M⁰¹]
    momentsMapping = MomentsMap(labelsOde)
    sigmaMapping = SigmaMap([:N, :M¹⁰, :M⁰¹])
    @show sigmaMapping #debug
    return Model(p, Ω, Ωc, IECF2BD_initial, IECF2BD_ODEs, ssaSys,
                    momentsMapping, sigmaMapping)
end

function getIECF2BDSSASystem(;
                            kI = 0.0, kE = 0.0,  # Intake/Exit rates for cells
                            kC = 0.0, kF = 0.0,  # Coag/Frag rates for cells
                            kb = 0.0, kd = 0.0,  # Birth/Death rates for X1
                            λ = 0,  # Parameter of the poisson distrib on intake
                            )
    S = Sim.System("IECF2BD", 2, # X1, X2
            [:N =>[0,0], # Number of compartments
             :M¹⁰ =>[1,0], # M¹⁰
             :M²⁰ =>[2,0], # M²⁰
             :M⁰¹ =>[0,1], # M⁰¹
             :M⁰² =>[0,2], # M⁰²
             :M¹¹ =>[1,1], # M¹¹
            ]
            )

    # cells' reaction network
    prodX1 = Sim.new_chemical_reaction_class([1,0], kb)
    prodX1.H = (n::SystemState, Mom::Moments) -> Mom[1]
    prodX1.fast_sample_reactants! = fast_sample_uniform_cell

    deathX1 = Sim.new_chemical_reaction_class([-1,0], kd)
    deathX1.H = (n::SystemState, Mom::Moments) -> Mom[2]
    deathX1.g = (xc::Compartments, Mom::Moments) -> xc[1][1]

    prodX2 = Sim.new_chemical_reaction_class([0,1], kb)
    prodX2.H = (n::SystemState, Mom::Moments) -> Mom[1]
    prodX2.fast_sample_reactants! = fast_sample_uniform_cell

    deathX2 = Sim.new_chemical_reaction_class([0,-1], kd)
    deathX2.H = (n::SystemState, Mom::Moments) -> Mom[4]
    deathX2.g = (xc::Compartments, Mom::Moments) -> xc[1][2]

    # Compartment reactions
    cellIntake = Sim.TransitionClass(0, 1, kI)
    cellIntake.H = (n::SystemState, Mom::Moments) -> 1
    # This is how the output compartment (yc) of the transition looks like
    cellIntake.pi = function(yc::Compartments, xc::Compartments)
                        yc[1][1] = rand(Poisson(λ))
                        yc[1][2] = rand(Poisson(λ))
                    end
    # cell_division.fast_sample_reactants! = fast_sample_cell_div

    cellExit = Sim.TransitionClass(1, 0, kE) # This is a cell death
    cellExit.H = (n::SystemState, Mom::Moments) -> Mom[1] # Depends on num cells
    cellExit.fast_sample_reactants! = fast_sample_uniform_cell

    coagulation = Sim.TransitionClass(2, 1, kC)
    coagulation.H = (n::SystemState, Mom::Moments) -> Mom[1]*(Mom[1]-1)/2
    coagulation.fast_sample_reactants! = fast_sample_uniform_2cells
    coagulation.pi = function(yc::Compartments, xc::Compartments)
                            yc[1][:] .= xc[1][:] .+ xc[2][:]
                        end

    fragmentation = Sim.TransitionClass(1, 2, kF)
    # fragmentation.H = (n::SystemState, Mom::Moments) -> div(Mom[3]-Mom[2], 2)
    fragmentation.g = (xc::Compartments, Mom::Moments) -> xc[1][1] * xc[1][2]
    # fragmentation.fast_sample_reactants! = fast_sample_x1_square
    fragmentation.pi = function(yc::Compartments, xc::Compartments)
                        yc[1][1] = rand(0:xc[1][1])
                        yc[1][2] = rand(0:xc[1][2])
                        yc[2][:] .= xc[1][:] .- yc[1][:]
                    end

    Sim.add_transition_class(S, prodX1, deathX1, prodX2, deathX2, 
        cellIntake, cellExit, coagulation, fragmentation)

    return S
end

function IECF2BD_ODEs(dM, M, parameters, t)
    c2 = parameters[:λ] # λ
    c4 = parameters[:kC] # kC
    c1 = parameters[:kE] # kE
    c3 = parameters[:kF] # kF
    c0 = parameters[:kI] # kI
    c6 = parameters[:kb] # kb
    c5 = parameters[:kd] # kd
    # Number of Compartments (N)
    dM[1] = c0+1/2*c4*M[1]-c1*M[1]-1/2*c4*((M[1])^(2))+c3*M[5]*M[3]/M[1]
    # N^2
    dM[2] = (1/2*((M[1])^(2))*(2*c0+c4*((M[1])^(2))-c4*M[1]-4*c1*M[2]+2*c4*((M[1])^(3))+2*c4*M[2]+2*c1*M[1]+4*c0*M[1]-4*c4*M[2]*M[1])+c3*(M[5]*M[3]+2*M[10]*M[3]+2*M[11]*M[5])*M[1]-2*c3*M[2]*M[5]*M[3])/((M[1])^(2))
    # Total Mass of species 1
    dM[3] = c2*c0+c6*M[1]-c1*M[3]-c5*M[3]
    # M1^2
    dM[4] = c2*c0+c0*((c2)^(2))+c6*M[1]+c5*M[3]-2*c1*M[4]-2*c5*M[4]+2*c6*M[11]+c1*((M[3])^(2))/M[1]+2*c2*c0*M[3]
    # Total Mass of species 2
    dM[5] = c2*c0+c6*M[1]-c1*M[5]-c5*M[5]
    # M2^2
    dM[6] = c2*c0+c0*((c2)^(2))+c6*M[1]+c5*M[5]-2*c1*M[6]-2*c5*M[6]+2*c6*M[10]+c1*((M[5])^(2))/M[1]+2*c2*c0*M[5]
    # Sum of squared content of species 1
    dM[7] = c0*((c2)^(2))+c6*M[5]+c6*M[3]-c4*M[7]-c1*M[7]-2*c5*M[7]+c4*M[5]*M[3]-1/2*c3*((M[5])^(2))*((M[3])^(2))/((M[1])^(3))
    # Sum of squared content of species 1
    dM[8] = c2*c0+c4*((M[3])^(2))+c0*((c2)^(2))+c6*M[1]+c5*M[3]-c4*M[8]-c1*M[8]-2*c5*M[8]+2*c6*M[3]-1/3*c3*((M[3])^(3))*M[5]/((M[1])^(3))+1/3*c3*((M[3])^(2))*M[5]/((M[1])^(2))
    # Sum of squared content of species 2
    dM[9] = c2*c0+c4*((M[5])^(2))+c0*((c2)^(2))+c6*M[1]+c5*M[5]-c4*M[9]-c1*M[9]-2*c5*M[9]+2*c6*M[5]-1/3*c3*((M[5])^(3))*M[3]/((M[1])^(3))+1/3*c3*((M[5])^(2))*M[3]/((M[1])^(2))
    # N*M2
    dM[10] = c2*c0+c1*M[5]+c0*M[5]+c6*M[2]+1/2*c4*M[10]-c5*M[10]-2*c1*M[10]+c2*c0*M[1]+1/2*c4*((M[1])^(2))*M[5]-c4*M[10]*M[1]+c3*M[6]*M[3]/M[1]+c3*M[12]*M[5]/M[1]-c3*M[10]*M[5]*M[3]/((M[1])^(2))
    # N*M1
    dM[11] = c2*c0+c1*M[3]+c0*M[3]+c6*M[2]+1/2*c4*M[11]-c5*M[11]-2*c1*M[11]+c2*c0*M[1]+1/2*c4*((M[1])^(2))*M[3]-c4*M[11]*M[1]+c3*M[4]*M[5]/M[1]+c3*M[12]*M[3]/M[1]-c3*M[11]*M[5]*M[3]/((M[1])^(2))
    # M2*M1
    dM[12] = c0*((c2)^(2))+c6*M[10]+c6*M[11]-2*c1*M[12]-2*c5*M[12]+c2*c0*M[5]+c2*c0*M[3]+c1*M[5]*M[3]/M[1]
    return
end

# initialize expected moments vector
function IECF2BD_initial(N0, Mpc0)
    M0 = N0*Mpc0
    MM0 = N0*Mpc0*Mpc0
    M = zeros(12)
    # Number of Compartments (N)
    M[1] = N0 # initial value for Moment(0, 0), please specify!
    # N^2
    M[2] = ((M[1])^(2))
    # Total Mass of species 1
    M[3] = M0 # initial value for Moment(1, 0), please specify!
    # M1^2
    M[4] = ((M[3])^(2))
    # Total Mass of species 2
    M[5] = M0 # initial value for Moment(0, 1), please specify!
    # M2^2
    M[6] = ((M[5])^(2))
    # Sum of squared content of species 1
    M[7] = MM0 # initial value for Moment(1, 1), please specify!
    # Sum of squared content of species 1
    M[8] = MM0 # initial value for Moment(2, 0), please specify!
    # Sum of squared content of species 2
    M[9] = MM0 # initial value for Moment(0, 2), please specify!
    # N*M2
    M[10] = M[1]*M[5]
    # N*M1
    M[11] = M[1]*M[3]
    # M2*M1
    M[12] = M[5]*M[3]
    return M
end

