function getIECF2BD_test2SSASystem(;
                            kI = 0.0, kE = 0.0,  # Intake/Exit rates for cells
                            kC = 0.0, kF = 0.0,  # Coag/Frag rates for cells
                            kb = 0.0, kd = 0.0,  # Birth/Death rates for X1
                            kMC = 0.0, hC = 4.0,
                            kMF = 0.0, hF = 4.0,
                            λ = 0,  # Parameter of the poisson distrib on intake
                            )
    S = Sim.System("IECF2BD_test2", 2, # X1, X2
            [:N =>[0,0], # Number of compartments
             :M¹⁰ =>[1,0], # M¹⁰
             :M²⁰ =>[2,0], # M²⁰
             :M⁰¹ =>[0,1], # M⁰¹
             :M⁰² =>[0,2], # M⁰²
             :M¹¹ =>[1,1], # M¹¹
            ]
            )

    _hill(X, kM, h) = X^h / ( kM^h + X^h )

    # cells' reaction network
    prodX1 = Sim.new_chemical_reaction_class([1,0], kb)
    prodX1.H = (n::SystemState, Mom::Moments) -> Mom[1]
    prodX1.fast_sample_reactants! = fast_sample_uniform_cell

    deathX1 = Sim.new_chemical_reaction_class([-1,0], kd)
    deathX1.H = (n::SystemState, Mom::Moments) -> Mom[2]
    deathX1.g = (xc::Compartments, Mom::Moments) -> xc[1][1]

    prodX2 = Sim.new_chemical_reaction_class([0,1], kb)
    prodX2.H = (n::SystemState, Mom::Moments) -> Mom[1]
    prodX2.fast_sample_reactants! = fast_sample_uniform_cell

    deathX2 = Sim.new_chemical_reaction_class([0,-1], kd)
    deathX2.H = (n::SystemState, Mom::Moments) -> Mom[4]
    deathX2.g = (xc::Compartments, Mom::Moments) -> xc[1][2]

    # Compartment reactions
    cellIntake = Sim.TransitionClass(0, 1, kI)
    cellIntake.H = (n::SystemState, Mom::Moments) -> 1
    # This is how the output compartment (yc) of the transition looks like
    cellIntake.pi = function(yc::Compartments, xc::Compartments)
                        yc[1][1] = rand(Poisson(λ))
                        yc[1][2] = rand(Poisson(λ))
                    end
    # cell_division.fast_sample_reactants! = fast_sample_cell_div

    cellExit = Sim.TransitionClass(1, 0, kE) # This is a cell death
    cellExit.H = (n::SystemState, Mom::Moments) -> Mom[1] # Depends on num cells
    cellExit.fast_sample_reactants! = fast_sample_uniform_cell

    imbalance(a,b) = (a-b)/(a+b)
    _coag(x,y) = ( imbalance(x[1], x[2]) + imbalance(y[1], y[2]) )^2
    _frag(x) = 1 - imbalance(x[1], x[2])^2

    coagulation = Sim.TransitionClass(2, 1, kC)
    coagulation.H = (n::SystemState, Mom::Moments) -> Mom[1]*(Mom[1]-1)/2
    coagulation.fast_sample_reactants! = fast_sample_uniform_2cells
    # coagulation.g = (xc::Compartments, Mom::Moments) -> (xc[1][1]-xc[1][2] + xc[2][1]-xc[2][2])^2
    # coagulation.g = (xc::Compartments, Mom::Moments) -> _hill( (xc[1][1]-xc[1][2] + xc[2][1]-xc[2][2])^2, kMC, hC )
    # coagulation.g = (xc::Compartments, Mom::Moments) -> _hill( _coag(xc[1], xc[2]), 1.0, 4 )
    coagulation.pi = function(yc::Compartments, xc::Compartments)
                            yc[1][:] .= xc[1][:] .+ xc[2][:]
                        end

    fragmentation = Sim.TransitionClass(1, 2, kF)
    # fragmentation.H = (n::SystemState, Mom::Moments) -> div(Mom[3]-Mom[2], 2)
    # fragmentation.g = (xc::Compartments, Mom::Moments) -> 1
    fragmentation.g = (xc::Compartments, Mom::Moments) -> xc[1][1] * xc[1][2]
    # fragmentation.g = (xc::Compartments, Mom::Moments) -> _hill( xc[1][1] * xc[1][2], kMF, hF )
    # fragmentation.g = (xc::Compartments, Mom::Moments) -> _hill( xc[1][1] * xc[1][2], kMF, 4 )
    # fragmentation.g = (xc::Compartments, Mom::Moments) -> _hill( _frag(xc[1]), 0.5, 4 )
    # fragmentation.g = (xc::Compartments, Mom::Moments) -> xc[1][1] + xc[1][2]
    # fragmentation.g = (xc::Compartments, Mom::Moments) -> xc[1][1]
    # fragmentation.g = (xc::Compartments, Mom::Moments) -> 1.
    # fragmentation.fast_sample_reactants! = fast_sample_x1_square
    fragmentation.pi = function(yc::Compartments, xc::Compartments)
                        yc[1][1] = rand(0:xc[1][1])
                        yc[1][2] = rand(0:xc[1][2])
                        # yc[1][1] = rand(Binomial(xc[1][1], 0.5))
                        # yc[1][2] = rand(Binomial(xc[1][2], 0.5))
                        # yc[1][1] = xc[1][1]
                        # yc[1][2] = 0
                        #
                        yc[2][:] .= xc[1][:] .- yc[1][:]
                    end

    Sim.add_transition_class(S, prodX1, deathX1, prodX2, deathX2, 
        cellIntake, cellExit, coagulation, fragmentation)

    return S
end

function IECF2BD_test2_ODEs_knownMoments(dM, M, parameters, t)
    c2 = parameters[:λ] # λ
    c3 = parameters[:kC] # kC
    c1 = parameters[:kE] # kE
    c6 = parameters[:kF] # kF
    c0 = parameters[:kI] # kI
    c5 = parameters[:kb] # kb
    c4 = parameters[:kd] # kd
    # Number of Compartments (N)
    dM[1] = c0+c6*M[7]+1/2*c3*M[1]-c1*M[1]-1/2*c3*((M[1])^(2))
    # N^2
    dM[2] = c0+c3*((M[1])^(3))+c3*M[2]+c1*M[1]+c6*M[7]+1/2*c3*((M[1])^(2))-2*c1*M[2]+2*c0*M[1]-1/2*c3*M[1]-2*c3*M[2]*M[1]+2*c6*M[10]*M[3]/M[1]+2*c6*M[11]*M[5]/M[1]-2*c6*M[2]*M[5]*M[3]/((M[1])^(2))
    # Total Mass of species 1
    dM[3] = c2*c0+c5*M[1]-c1*M[3]-c4*M[3]
    # M1^2
    dM[4] = c2*c0+c1*M[8]+c0*((c2)^(2))+c5*M[1]+c4*M[3]-2*c1*M[4]-2*c4*M[4]+2*c5*M[11]+2*c2*c0*M[3]
    # Total Mass of species 2
    dM[5] = c2*c0+c5*M[1]-c1*M[5]-c4*M[5]
    # M2^2
    dM[6] = c2*c0+c1*M[9]+c0*((c2)^(2))+c5*M[1]+c4*M[5]-2*c1*M[6]-2*c4*M[6]+2*c5*M[10]+2*c2*c0*M[5]
    # Sum of squared content of species 1
    dM[7] = c0*((c2)^(2))+c5*M[5]+c5*M[3]-c3*M[7]-c1*M[7]-2*c4*M[7]+c3*M[5]*M[3]-1/2*c6*((M[5])^(2))*((M[3])^(2))/((M[1])^(3))
    # Sum of squared content of species 1
    dM[8] = c2*c0+c3*((M[3])^(2))+c0*((c2)^(2))+c5*M[1]+c4*M[3]-c3*M[8]-c1*M[8]-2*c4*M[8]+2*c5*M[3]-1/3*c6*((M[3])^(3))*M[5]/((M[1])^(3))+1/3*c6*((M[3])^(2))*M[5]/((M[1])^(2))
    # Sum of squared content of species 2
    dM[9] = c2*c0+c3*((M[5])^(2))+c0*((c2)^(2))+c5*M[1]+c4*M[5]-c3*M[9]-c1*M[9]-2*c4*M[9]+2*c5*M[5]-1/3*c6*((M[5])^(3))*M[3]/((M[1])^(3))+1/3*c6*((M[5])^(2))*M[3]/((M[1])^(2))
    # N*M2
    dM[10] = c2*c0+c1*M[5]+c0*M[5]+c5*M[2]+1/2*c3*M[10]-c4*M[10]-2*c1*M[10]+c2*c0*M[1]+1/2*c3*((M[1])^(2))*M[5]-c3*M[10]*M[1]+c6*M[6]*M[3]/M[1]+c6*M[12]*M[5]/M[1]-c6*M[10]*M[5]*M[3]/((M[1])^(2))
    # N*M1
