    # Total Mass of species 1
    dM[3] = c1*c2+c5*M[1]-c6*M[3]-c0*M[3]
    # M1^2
    dM[4] = c1*c2+c2*((c1)^(2))+c5*M[1]+c0*M[3]-2*c6*M[4]-2*c0*M[4]+2*c5*M[11]+c6*((M[3])^(2))/M[1]+2*c1*c2*M[3]
    # Total Mass of species 2
    dM[5] = c1*c2+c5*M[1]-c6*M[5]-c0*M[5]
    # M2^2
