    # Sum of squared content of species 1
    dM[7] = 1/2*(-c7*((M[5])^(9))*((M[3])^(9))+2*(((c4)^(8))*((M[1])^(16))+((M[5])^(8))*((M[3])^(8))+2*((c4)^(4))*((M[1])^(8))*((M[5])^(4))*((M[3])^(4)))*(c2*((c1)^(2))+c5*M[5]+c5*M[3]-c3*M[7]-c6*M[7]-2*c0*M[7]+c3*M[5]*M[3])*M[1]-c7*((c4)^(4))*((M[1])^(8))*((M[5])^(5))*((M[3])^(5)))/((((c4)^(8))*((M[1])^(16))+((M[5])^(8))*((M[3])^(8))+2*((c4)^(4))*((M[1])^(8))*((M[5])^(4))*((M[3])^(4)))*M[1])
    # Sum of squared content of species 1
    dM[8] = 1/3*(-c7*((M[5])^(8))*((M[3])^(10))+3*(((c4)^(8))*((M[1])^(16))+((M[5])^(8))*((M[3])^(8))+2*((c4)^(4))*((M[1])^(8))*((M[5])^(4))*((M[3])^(4)))*(c1*c2+c3*((M[3])^(2))+c2*((c1)^(2))+c5*M[1]+c0*M[3]-c3*M[8]-c6*M[8]-2*c0*M[8]+2*c5*M[3])*M[1]+c7*((M[5])^(8))*((M[3])^(9))*M[1]+c7*((c4)^(4))*((M[1])^(9))*((M[5])^(4))*((M[3])^(5))-c7*((c4)^(4))*((M[1])^(8))*((M[5])^(4))*((M[3])^(6)))/((((c4)^(8))*((M[1])^(16))+((M[5])^(8))*((M[3])^(8))+2*((c4)^(4))*((M[1])^(8))*((M[5])^(4))*((M[3])^(4)))*M[1])
    # Sum of squared content of species 2
