    # N*M2
    dM[10] = (1/2*(((c4)^(8))*((M[1])^(16))+((M[5])^(8))*((M[3])^(8))+2*((c4)^(4))*((M[1])^(8))*((M[5])^(4))*((M[3])^(4)))*(c3*M[10]-4*c6*M[10]-2*c0*M[10]+2*c1*c2+2*c6*M[5]+2*c2*M[5]+2*c5*M[2]+c3*((M[1])^(2))*M[5]-2*c3*M[10]*M[1]+2*c1*c2*M[1])+c7*((M[5])^(8))*((M[3])^(8))*M[10]-7*c7*((c4)^(4))*((M[1])^(8))*((M[5])^(4))*((M[3])^(4))*M[10]+4*c7*((c4)^(4))*((M[1])^(9))*((M[5])^(3))*((M[3])^(4))*M[6]+4*c7*((c4)^(4))*((M[1])^(9))*((M[5])^(4))*((M[3])^(3))*M[12])/(((c4)^(8))*((M[1])^(16))+((M[5])^(8))*((M[3])^(8))+2*((c4)^(4))*((M[1])^(8))*((M[5])^(4))*((M[3])^(4)))
    # N*M1
    dM[11] = (1/2*(((c4)^(8))*((M[1])^(16))+((M[5])^(8))*((M[3])^(8))+2*((c4)^(4))*((M[1])^(8))*((M[5])^(4))*((M[3])^(4)))*(c3*M[11]-4*c6*M[11]-2*c0*M[11]+2*c1*c2+2*c6*M[3]+2*c2*M[3]+2*c5*M[2]+c3*((M[1])^(2))*M[3]-2*c3*M[11]*M[1]+2*c1*c2*M[1])+c7*((M[5])^(8))*((M[3])^(8))*M[11]-7*c7*((c4)^(4))*((M[1])^(8))*((M[5])^(4))*((M[3])^(4))*M[11]+4*c7*((c4)^(4))*((M[1])^(9))*((M[5])^(3))*((M[3])^(4))*M[12]+4*c7*((c4)^(4))*((M[1])^(9))*((M[5])^(4))*((M[3])^(3))*M[4])/(((c4)^(8))*((M[1])^(16))+((M[5])^(8))*((M[3])^(8))+2*((c4)^(4))*((M[1])^(8))*((M[5])^(4))*((M[3])^(4)))
    # M2*M1
    dM[12] = c2*((c1)^(2))+c5*M[10]+c5*M[11]-2*c6*M[12]-2*c0*M[12]+c1*c2*M[5]+c1*c2*M[3]+c6*M[5]*M[3]/M[1]
    return
end

function _randInit(d, N0, Mpc0, σ=Mpc0*0.2)
    dist = Normal(Mpc0, σ)
    return round.(Int, abs.(rand(dist, N0,d)))
end


# initialize expected moments vector
function IECF2BD_test2_initial(N0, Mpc0)
    M0 = N0*Mpc0
    MM0 = N0*Mpc0*Mpc0
    M = zeros(12)
    # Number of Compartments (N)
    M[1] = N0 # initial value for Moment(0, 0), please specify!
    # N^2
    M[2] = ((M[1])^(2))
    # Total Mass of species 1
    M[3] = M0 # initial value for Moment(1, 0), please specify!
    # M1^2
    M[4] = ((M[3])^(2))
    # Total Mass of species 2
    M[5] = M0 # initial value for Moment(0, 1), please specify!
    # M2^2
    M[6] = ((M[5])^(2))
    # Sum of squared content of species 1
    M[7] = MM0 # initial value for Moment(1, 1), please specify!
    # Sum of squared content of species 1
    M[8] = MM0 # initial value for Moment(2, 0), please specify!
    # Sum of squared content of species 2
    M[9] = MM0 # initial value for Moment(0, 2), please specify!
    # N*M1
    M[10] = M[1]*M[3]
    # N*M2
    M[11] = M[1]*M[5]
    # M2*M1
    M[12] = M[5]*M[3]
    return M
end
