##################### IntakeExitCoagulation2FragmentationSpeciesBirthDeath
@export function IEC2FBD(;  
                            kI=1.0, kE=0.01, 
                            kC=1e-4, kF=2*5e-7, 
                            kb=0.0, kd=0.0, 
                            # kb=0.0, kd=0.05, 
                            λ=100.0, 
                            Ω=1.0, Ωc=1.0,
                            )
    kI, kE, kC, kF, kb, kd, λ, Ω, Ωc = float.( (kI, kE, kC, kF, kb, kd, λ, Ω, Ωc) )
    kI *= Ω; kC /= Ω
    kb *= Ωc;
    λ *= Ωc;
    p = Dict(:kI=>kI, :kE=>kE, :kC=>kC, :kF=>kF, :kb=>kb, :kd=>kd, :λ=>λ, 
                :Ω=>Ω, :Ωc=>Ωc,
                )
    ssaSys = getIEC2FBDSSASystem(; kI=kI, kE=kE, kC=kC, kF=kF, kb=kb, kd=kd, λ=λ)
    labelsOde = [:N, :N2, :M¹⁰, :M¹⁰2, :M⁰¹, :M⁰¹2, :M¹¹, :M²⁰, :M⁰², :NM¹⁰, :NM⁰¹, :M¹⁰M⁰¹]
    momentsMapping = MomentsMap(labelsOde)
    sigmaMapping = SigmaMap([:N, :M¹⁰, :M⁰¹])
    @show sigmaMapping #debug
    return Model(p, Ω, Ωc, IEC2FBD_initial, IEC2FBD_ODEs, ssaSys,
                    momentsMapping, sigmaMapping)
end

function getIEC2FBDSSASystem(;
                            kI = 0.0, kE = 0.0,  # Intake/Exit rates for cells
                            kC = 0.0, kF = 0.0,  # Coag/Frag rates for cells
                            kb = 0.0, kd = 0.0,  # Birth/Death rates for X1
                            λ = 0,  # Parameter of the poisson distrib on intake
                            )
    S = Sim.System("IEC2FBD", 2, # X1, X2
            [:N =>[0,0], # Number of compartments
             :M¹⁰ =>[1,0], # M¹⁰
             :M²⁰ =>[2,0], # M²⁰
             :M⁰¹ =>[0,1], # M⁰¹
             :M⁰² =>[0,2], # M⁰²
             :M¹¹ =>[1,1], # M¹¹
            ]
            )

    # cells' reaction network
    prodX1 = Sim.new_chemical_reaction_class([1,0], kb)
    prodX1.H = (n::SystemState, Mom::Moments) -> Mom[1]
    prodX1.fast_sample_reactants! = fast_sample_uniform_cell

    deathX1 = Sim.new_chemical_reaction_class([-1,0], kd)
    deathX1.H = (n::SystemState, Mom::Moments) -> Mom[2]
    deathX1.g = (xc::Compartments, Mom::Moments) -> xc[1][1]

    prodX2 = Sim.new_chemical_reaction_class([0,1], kb)
    prodX2.H = (n::SystemState, Mom::Moments) -> Mom[1]
    prodX2.fast_sample_reactants! = fast_sample_uniform_cell

    deathX2 = Sim.new_chemical_reaction_class([0,-1], kd)
    deathX2.H = (n::SystemState, Mom::Moments) -> Mom[4]
    deathX2.g = (xc::Compartments, Mom::Moments) -> xc[1][2]

    # Compartment reactions
    cellIntake = Sim.TransitionClass(0, 1, kI)
    cellIntake.H = (n::SystemState, Mom::Moments) -> 1
    # This is how the output compartment (yc) of the transition looks like
    cellIntake.pi = function(yc::Compartments, xc::Compartments)
                        yc[1][1] = rand(Poisson(λ))
                        yc[1][2] = rand(Poisson(λ))
                    end
    # cell_division.fast_sample_reactants! = fast_sample_cell_div

    cellExit = Sim.TransitionClass(1, 0, kE) # This is a cell death
    cellExit.H = (n::SystemState, Mom::Moments) -> Mom[1] # Depends on num cells
    cellExit.fast_sample_reactants! = fast_sample_uniform_cell

    coagulation = Sim.TransitionClass(2, 1, kC)
    # coagulation.H = (n::SystemState, Mom::Moments) -> Mom[1]*(Mom[1]-1)/2
    # coagulation.fast_sample_reactants! = fast_sample_uniform_2cells
    coagulation.g = (xc::Compartments, Mom::Moments) -> ( κ=(xc[1][1] * xc[2][1])/(xc[1][2] * xc[2][2]); κ+(1/κ) )
    coagulation.pi = function(yc::Compartments, xc::Compartments)
                            yc[1][:] .= xc[1][:] .+ xc[2][:]
                        end

    fragmentation = Sim.TransitionClass(1, 2, kF)
    fragmentation.H = (n::SystemState, Mom::Moments) -> Mom[1]
    # fragmentation.g = (xc::Compartments, Mom::Moments) -> xc[1][1] * xc[1][2]
    fragmentation.fast_sample_reactants! = fast_sample_uniform_cell
    fragmentation.pi = function(yc::Compartments, xc::Compartments)
                        yc[1][1] = rand(0:xc[1][1])
                        yc[1][2] = rand(0:xc[1][2])
                        yc[2][:] .= xc[1][:] .- yc[1][:]
                    end

    Sim.add_transition_class(S, prodX1, deathX1, prodX2, deathX2, 
        cellIntake, cellExit, coagulation, fragmentation)

    return S
end

function IEC2FBD_ODEs(dM, M, parameters, t)
    c1 = parameters[:λ] # λ
    c0 = parameters[:kC] # kC
    c5 = parameters[:kE] # kE
    c4 = parameters[:kF] # kF
    c2 = parameters[:kI] # kI
    c3 = parameters[:kb] # kb
    c6 = parameters[:kd] # kd
    # Number of Compartments (N)
    dM[1] = 1/2*(2*((M[5])^(2))*((M[3])^(2))*(c2+c4*M[1]-c5*M[1])-c0*((M[5])^(4))*(-1+M[1])*M[1]-c0*((M[3])^(4))*(-1+M[1])*M[1])/(((M[5])^(2))*((M[3])^(2)))
    # N^2
    dM[2] = 1/2*(2*((M[5])^(3))*((M[3])^(3))*(c2+c5*M[1]+c4*M[1]-2*c5*M[2]+2*c4*M[2]+2*c2*M[1])+c0*((M[5])^(4))*(((M[1])^(2))*M[5]-M[1]*M[5]-4*((M[1])^(2))*M[11]+2*((M[1])^(3))*M[5]+2*M[2]*M[5]+4*M[11]*M[1]-4*M[2]*M[1]*M[5])*M[3]+c0*((M[3])^(4))*(((M[1])^(2))*M[3]-M[1]*M[3]-4*((M[1])^(2))*M[10]+2*((M[1])^(3))*M[3]+2*M[2]*M[3]+4*M[10]*M[1]-4*M[2]*M[1]*M[3])*M[5]+4*c0*((M[5])^(5))*(-1+M[1])*M[10]*M[1]+4*c0*((M[3])^(5))*(-1+M[1])*M[11]*M[1])/(((M[5])^(3))*((M[3])^(3)))
    # Total Mass of species 1
    dM[3] = c1*c2+c3*M[1]-c5*M[3]-c6*M[3]
    # M1^2
    dM[4] = c1*c2+c2*((c1)^(2))+c3*M[1]+c6*M[3]-2*c5*M[4]-2*c6*M[4]+2*c3*M[10]+c5*((M[3])^(2))/M[1]+2*c1*c2*M[3]
    # Total Mass of species 2
    dM[5] = c1*c2+c3*M[1]-c5*M[5]-c6*M[5]
    # M2^2
    dM[6] = c1*c2+c2*((c1)^(2))+c3*M[1]+c6*M[5]-2*c5*M[6]-2*c6*M[6]+2*c3*M[11]+c5*((M[5])^(2))/M[1]+2*c1*c2*M[5]
    # Sum of squared content of species 1
    dM[7] = c2*((c1)^(2))+c3*M[5]+c3*M[3]-c5*M[7]-2*c6*M[7]-1/2*c4*M[7]+c0*((M[3])^(3))/M[5]+c0*((M[5])^(3))/M[3]-c0*((M[3])^(3))/(M[1]*M[5])-c0*((M[5])^(3))/(M[1]*M[3])
    # Sum of squared content of species 1
    dM[8] = c1*c2+c0*((M[5])^(2))+c2*((c1)^(2))+c3*M[1]+c6*M[3]-c5*M[8]-2*c6*M[8]+2*c3*M[3]-1/3*c4*M[8]+1/3*c4*M[3]+c0*((M[3])^(4))/((M[5])^(2))-c0*((M[5])^(2))/M[1]-c0*((M[3])^(4))/(M[1]*((M[5])^(2)))
    # Sum of squared content of species 2
    dM[9] = c1*c2+c0*((M[3])^(2))+c2*((c1)^(2))+c3*M[1]+c6*M[5]-c5*M[9]-2*c6*M[9]+2*c3*M[5]-1/3*c4*M[9]+1/3*c4*M[5]+c0*((M[5])^(4))/((M[3])^(2))-c0*((M[3])^(2))/M[1]-c0*((M[5])^(4))/(M[1]*((M[3])^(2)))
    # N*M1
    dM[10] = 1/2*(2*((M[5])^(3))*((M[3])^(3))*(c1*c2+c5*M[3]+c4*M[10]+c2*M[3]+c3*M[2]-c6*M[10]-2*c5*M[10]+c1*c2*M[1])+c0*((M[1])^(2))*((M[5])^(5))*((M[3])^(2))+c0*((M[3])^(4))*(((M[1])^(2))*((M[3])^(2))+M[10]*M[3]-2*((M[1])^(2))*M[4]+2*M[4]*M[1]-2*M[10]*M[1]*M[3])*M[5]-c0*((M[5])^(4))*(-M[10]*M[5]-2*M[12]*M[1]+2*((M[1])^(2))*M[12]+2*M[10]*M[1]*M[5])*M[3]+2*c0*((M[5])^(5))*(-1+M[1])*M[4]*M[1]+2*c0*((M[3])^(5))*(-1+M[1])*M[12]*M[1])/(((M[5])^(3))*((M[3])^(3)))
    # N*M2
    dM[11] = 1/2*(2*((M[5])^(3))*((M[3])^(3))*(c1*c2+c5*M[5]+c4*M[11]+c2*M[5]+c3*M[2]-c6*M[11]-2*c5*M[11]+c1*c2*M[1])+c0*((M[1])^(2))*((M[5])^(2))*((M[3])^(5))+c0*((M[5])^(4))*(((M[1])^(2))*((M[5])^(2))+M[11]*M[5]-2*((M[1])^(2))*M[6]+2*M[6]*M[1]-2*M[11]*M[1]*M[5])*M[3]-c0*((M[3])^(4))*(-M[11]*M[3]-2*M[12]*M[1]+2*((M[1])^(2))*M[12]+2*M[11]*M[1]*M[3])*M[5]+2*c0*((M[5])^(5))*(-1+M[1])*M[12]*M[1]+2*c0*((M[3])^(5))*(-1+M[1])*M[6]*M[1])/(((M[5])^(3))*((M[3])^(3)))
    # M2*M1
    dM[12] = c2*((c1)^(2))+c3*M[11]+c3*M[10]-2*c5*M[12]-2*c6*M[12]+c1*c2*M[5]+c1*c2*M[3]+c5*M[5]*M[3]/M[1]
    return
end

# initialize expected moments vector
function IEC2FBD_initial(N0, Mpc0)
    M0 = N0*Mpc0
    MM0 = N0*Mpc0*Mpc0
    M = zeros(12)
    # Number of Compartments (N)
    M[1] = N0 # initial value for Moment(0, 0), please specify!
    # N^2
    M[2] = ((M[1])^(2))
    # Total Mass of species 1
    M[3] = M0 # initial value for Moment(1, 0), please specify!
    # M1^2
    M[4] = ((M[3])^(2))
    # Total Mass of species 2
    M[5] = M0 # initial value for Moment(0, 1), please specify!
    # M2^2
    M[6] = ((M[5])^(2))
    # Sum of squared content of species 1
    M[7] = MM0 # initial value for Moment(1, 1), please specify!
    # Sum of squared content of species 1
    M[8] = MM0 # initial value for Moment(2, 0), please specify!
    # Sum of squared content of species 2
    M[9] = MM0 # initial value for Moment(0, 2), please specify!
    # N*M1
    M[10] = M[1]*M[3]
    # N*M2
    M[11] = M[1]*M[5]
    # M2*M1
    M[12] = M[5]*M[3]
    return M
end

##################### Mutual Repression
@export function MutualRepression(;  
                            kE=1e-2, 
                            kF=1e-1, 
                            kb=1e0, kd=1e0, 
                            kMR0=25, kMR1=25,
                            Ω=1.0, Ωc=1.0,
                            )
    kE, kF, kb, kd, kMR0, kMR1, Ω, Ωc = float.( (kE, kF, kb, kd, kMR0, kMR1, Ω, Ωc) )
    kb *= Ωc;
    p = Dict(:kE=>kE, :kF=>kF, :kb=>kb, :kd=>kd, 
                :kMR0=>kMR0,
                :kMR1=>kMR1,
                :Ω=>Ω, :Ωc=>Ωc,
                )
    ssaSys = getMutualRepressionSSASystem(; kE=kE, kF=kF, kb=kb, kd=kd, 
                                            kMR0=kMR0, kMR1=kMR1,
                                            )
    labelsOde = [:N, :N2, :M¹⁰, :M¹⁰2, :M⁰¹, :M⁰¹2, :M¹¹, :M²⁰, :M⁰²]
    momentsMapping = MomentsMap(labelsOde)
    sigmaMapping = SigmaMap([:N, :M¹⁰, :M⁰¹])
    # @show sigmaMapping #debug
    return Model(p, Ω, Ωc, MutualRepression_initial, MutualRepression_ODEs, ssaSys,
                    momentsMapping, sigmaMapping)
end

function getMutualRepressionSSASystem(;
                            kE = 0.0,  # Exit rates for cells
                            kF = 0.0,  # Frag rates for cells
                            kb = 0.0, kd = 0.0,  # Birth/Death rates for X1
                            kMR0 = 0.0, kMR1 = 0.0,
                            )
    S = Sim.System("MutualRepression", 2, # X1, X2
            [:N =>[0,0], # Number of compartments
             :M¹⁰ =>[1,0], # M¹⁰
             :M²⁰ =>[2,0], # M²⁰
             :M⁰¹ =>[0,1], # M⁰¹
             :M⁰² =>[0,2], # M⁰²
             :M¹¹ =>[1,1], # M¹¹
            ]
            )
    _reprMM(x,k) = k/(k+x)

    # cells' reaction network
    prodX1 = Sim.new_chemical_reaction_class([1,0], kb)
    prodX1.g = (xc::Compartments, Mom::Moments) -> _reprMM(xc[1][2], kMR0)

    deathX1 = Sim.new_chemical_reaction_class([-1,0], kd)
    deathX1.H = (n::SystemState, Mom::Moments) -> Mom[2]
    deathX1.g = (xc::Compartments, Mom::Moments) -> xc[1][1]

    prodX2 = Sim.new_chemical_reaction_class([0,1], kb)
    prodX2.g = (xc::Compartments, Mom::Moments) -> _reprMM(xc[1][1], kMR1)
    
    deathX2 = Sim.new_chemical_reaction_class([0,-1], kd)
    deathX2.H = (n::SystemState, Mom::Moments) -> Mom[4]
    deathX2.g = (xc::Compartments, Mom::Moments) -> xc[1][2]

    cellExit = Sim.TransitionClass(2, 1, kE) # This is a cell death
    cellExit.H = (n::SystemState, Mom::Moments) -> Mom[1]*(Mom[1]-1)/2
    cellExit.fast_sample_reactants! = fast_sample_uniform_2cells
    cellExit.pi = function(yc::Compartments, xc::Compartments)
                    yc[1][:] .= xc[1][:]
                end

    fragmentation = Sim.TransitionClass(1, 2, kF)
    fragmentation.H = (n::SystemState, Mom::Moments) -> Mom[1]
    fragmentation.fast_sample_reactants! = fast_sample_uniform_cell
    fragmentation.pi = function(yc::Compartments, xc::Compartments)
                        yc[1][1] = rand(0:xc[1][1])
                        yc[1][2] = rand(0:xc[1][2])
                        yc[2][:] .= xc[1][:] .- yc[1][:]
                    end

    Sim.add_transition_class(S, prodX1, deathX1, prodX2, deathX2, 
        cellExit, fragmentation)

    return S
end

function MutualRepression_ODEs(dM, M, parameters, t)
    c3 = parameters[:kMR0] # kMR0
    c4 = parameters[:kMR1] # kMR1
    c0 = parameters[:kE] # kE
    c1 = parameters[:kF] # kF
    c5 = parameters[:kb] # kb
    c2 = parameters[:kd] # kd
    # Number of Compartments (N)
    dM[1] = c1*M[1]+1/2*c0*M[1]-1/2*c0*M[2]
    # N^2
