    # M2^2
    M[6] = ((M[5])^(2))
    # Sum of squared content of species 1
    M[7] = MM0ab # initial value for Moment(1, 1), please specify!
    # Sum of squared content of species 1
    M[8] = MM0a # initial value for Moment(2, 0), please specify!
    # Sum of squared content of species 2
    M[9] = MM0b # initial value for Moment(0, 2), please specify!
    # S2*M1
    M[10] = M[9]*M[3]
    # M2*M1
    M[11] = M[5]*M[3]
    # N*S1
    M[12] = M[1]*M[8]
    # N*S2
    M[13] = M[1]*M[9]
    # N*S1
    M[14] = M[1]*M[7]
    # N*M1
    M[15] = M[1]*M[3]
    # M2*S1
    M[16] = M[5]*M[8]
    # N*M2
    M[17] = M[1]*M[5]
    # S1^2
    M[18] = ((M[8])^(2))
    # S2^2
    M[19] = ((M[9])^(2))
    # M2*S1
    M[20] = M[5]*M[7]
    # M1*S1
    M[21] = M[3]*M[8]
    # M1*S1
    M[22] = M[3]*M[7]
    # M2*S2
    M[23] = M[5]*M[9]
