# initialize expected moments vector
function MutualRepression3_initial(N0, Mpc0, Mpc0b=Mpc0)
    M0a = N0*Mpc0
    M0b = N0*Mpc0b
    MM0aa = N0*Mpc0*Mpc0
    MM0bb = N0*Mpc0b*Mpc0b
    MM0ab = N0*Mpc0*Mpc0b
    MMM0aaa = N0*Mpc0*Mpc0*Mpc0
    MMM0aab = N0*Mpc0*Mpc0*Mpc0b
    MMM0abb = N0*Mpc0b*Mpc0b*Mpc0
    MMM0bbb = N0*Mpc0b*Mpc0b*Mpc0b
    M = zeros(65)
    # Number of Compartments (N)
    M[1] = N0 # initial value for Moment(0, 0), please specify!
    # N^2
    M[2] = ((M[1])^(2))
    # Total Mass of species 1
    M[3] = M0a # initial value for Moment(1, 0), please specify!
    # M1^2
    M[4] = ((M[3])^(2))
    # Total Mass of species 2
    M[5] = M0b # initial value for Moment(0, 1), please specify!
    # M2^2
    M[6] = ((M[5])^(2))
    # Sum of squared content of species 1
    M[7] = MM0ab # initial value for Moment(1, 1), please specify!
    # Sum of squared content of species 1
    M[8] = MM0aa # initial value for Moment(2, 0), please specify!
    # Sum of squared content of species 2
    M[9] = MM0bb # initial value for Moment(0, 2), please specify!
    # M2*S1
    M[10] = M[5]*M[8]
    # S2*M1
    M[11] = M[9]*M[3]
    M[12] = MMM0aab # initial value for Moment(2, 1), please specify!
    # N*S2
    M[13] = M[1]*M[9]
    M[14] = MMM0abb # initial value for Moment(1, 2), please specify!
    # M2*M1
    M[15] = M[5]*M[3]
    # N*S1
    M[16] = M[1]*M[8]
    # N*S1
    M[17] = M[1]*M[7]
    M[18] = MMM0aaa # initial value for Moment(3, 0), please specify!
    M[19] = M[5]*M[18]
    M[20] = MMM0bbb # initial value for Moment(0, 3), please specify!
    # N*M1
    M[21] = M[1]*M[3]
    # N*M2
    M[22] = M[1]*M[5]
    M[23] = M[20]*M[3]
    M[24] = M[1]*M[18]
    M[25] = M[3]*M[18]
    # S2^2
    M[26] = ((M[9])^(2))
    M[27] = M[3]*M[14]
    # M1*S1
    M[28] = M[3]*M[8]
    M[29] = M[1]*M[14]
    M[30] = M[5]*M[14]
    # S1^2
    M[31] = ((M[8])^(2))
    M[32] = M[8]*M[18]
    M[33] = ((M[20])^(2))
    # M2*S2
    M[34] = M[5]*M[9]
    M[35] = M[1]*M[20]
    M[36] = M[3]*M[12]
    M[37] = M[1]*M[12]
    M[38] = M[5]*M[20]
    # M1*S1
    M[39] = M[3]*M[7]
    M[40] = M[5]*M[12]
    M[41] = M[9]*M[20]
    M[42] = ((M[18])^(2))
    # M2*S1
    M[43] = M[5]*M[7]
    M[44] = M[9]*M[12]
    M[45] = M[20]*M[12]
    M[46] = M[8]*M[12]
    M[47] = M[12]*M[18]
    M[48] = M[20]*M[14]
    M[49] = M[9]*M[14]
    # S2*S1
    M[50] = M[9]*M[7]
    M[51] = M[20]*M[8]
    M[52] = M[9]*M[18]
    # S2*S1
    M[53] = M[9]*M[8]
    M[54] = M[20]*M[7]
    M[55] = M[20]*M[18]
    M[56] = M[14]*M[18]
    # S1*S1
    M[57] = M[7]*M[8]
    M[58] = M[7]*M[18]
    M[59] = M[14]*M[8]
    M[60] = ((M[12])^(2))
    M[61] = ((M[14])^(2))
    M[62] = M[14]*M[12]
    M[63] = M[7]*M[14]
    M[64] = M[7]*M[12]
    # S1^2
    M[65] = ((M[7])^(2))
    return M
end

##################### QuorumSensing
@export function QuorumSensing(;  
                            kA=2e-2, kMapo=10,
                            kD=1e-2, 
                            kMtxn=10,
                            ktxn=1, ktsl=1,
                            kdr=1e-1, kdp=1e-1, kDP=1, kDD=1e-1,
                            Ω=1.0, Ωc=1.0,
                            )
    kA, kMapo, kD, kMtxn, ktxn, ktsl, kdr, kdp, kDP, kDD, Ω, Ωc = float.(  
            (kA, kMapo, kD, kMtxn, ktxn, ktsl, kdr, kdp, kDP, kDD, Ω, Ωc) 
        )
    p = Dict(:kA=>kA, :kMapo=>kMapo, :kD=>kD, :kMtxn=>kMtxn, 
                :ktxn=>ktxn, :ktsl=>ktsl, 
                :kdr=>kdr, :kdp=>kdp, :kDP=>kDP, :kDD=>kDD,
                :Ω=>Ω, :Ωc=>Ωc,
                )
    ssaSys = getQuorumSensingSSASystem(; kA=kA, kMapo=kMapo, kD=kD, kMtxn=kMtxn, 
                    ktxn=ktxn, ktsl=ktsl, kdr=kdr, kdp=kdp, kDP=kDP, kDD=kDD)
    labelsOde = [:N, :N2, :M¹⁰⁰, :M¹⁰⁰2, :M⁰¹⁰, :M⁰¹⁰2, :M⁰⁰¹, :M⁰⁰¹2, :M¹¹⁰, :M¹⁰¹, :M⁰¹¹ ]
    momentsMapping = MomentsMap(labelsOde)
    sigmaMapping = SigmaMap([:N, :M¹⁰⁰, :M⁰¹⁰, :M⁰⁰¹])
    # @show sigmaMapping #debug
    return Model(p, Ω, Ωc, QuorumSensing_initial, QuorumSensing_ODEs, ssaSys,
                    momentsMapping, sigmaMapping)
end

function getQuorumSensingSSASystem(;
                            kA=0, kMapo=0, kD=0,
                            kMtxn=0, ktxn=0, ktsl=0, 
                            kdr=0, kdp=0, kDP=0, kDD=0,
                            )
    S = Sim.System("QuorumSensing", 3, # RNA, Protein, Diffusible
            [:N =>[0,0,0], # Number of compartments
             :M¹⁰⁰ =>[1,0,0], # M¹⁰⁰
             :M²⁰⁰ =>[2,0,0], # M²⁰⁰
             :M⁰¹⁰ =>[0,1,0], # M⁰¹⁰
             :M⁰²⁰ =>[0,2,0], # M⁰²⁰
             :M⁰⁰¹ =>[0,0,1], # M⁰⁰¹
             :M⁰⁰² =>[0,0,2], # M⁰⁰²
             :M¹¹⁰ =>[1,1,0], # M¹¹⁰
             :M¹⁰¹ =>[1,0,1], # M¹⁰¹
             :M⁰¹¹ =>[0,1,1], # M⁰¹¹
            ]
            )

    _mm(x,k) = x / (k + x)

    # cells' reaction network
    txn = Sim.new_chemical_reaction_class([1,0,0], ktxn)
    txn.g = (xc::Compartments, Mom::Moments) -> _mm(Mom[6]/Mom[1], kMtxn)

    # tsl = Sim.new_chemical_reaction_class([0,1,0], ktsl)
    # tsl.g = (xc::Compartments, Mom::Moments) -> xc[1][1]

    diffProd = Sim.new_chemical_reaction_class([0,0,1], kDP)
    diffProd.g = (xc::Compartments, Mom::Moments) -> 1

    rnaDeg = Sim.new_chemical_reaction_class([-1,0,0], kdr)
    rnaDeg.g = (xc::Compartments, Mom::Moments) -> xc[1][1]

    # prtDeg = Sim.new_chemical_reaction_class([0,-1,0], kdp)
    # prtDeg.g = (xc::Compartments, Mom::Moments) -> xc[1][2]

    diffDeg = Sim.new_chemical_reaction_class([0,0,-1], kDD)
    diffDeg.g = (xc::Compartments, Mom::Moments) -> xc[1][3]

    Apoptosis = Sim.TransitionClass(2, 1, kA) # This is a cell death
    Apoptosis.g = (xc::Compartments, Mom::Moments) -> xc[1][1]
    # Apoptosis.g = (xc::Compartments, Mom::Moments) -> _mm(xc[1][2], kMapo)
    # Apoptosis.g = (xc::Compartments, Mom::Moments) -> _mm(xc[1][1], kMapo)
    Apoptosis.pi = function(yc::Compartments, xc::Compartments)
                        yc[1][1] = xc[2][1]
                        yc[1][2] = xc[2][2]
                        yc[1][3] = xc[1][3] + xc[2][3]
                    end

    Division = Sim.TransitionClass(1, 2, kD)
    Division.H = (n::SystemState, Mom::Moments) -> Mom[1]
    Division.fast_sample_reactants! = fast_sample_uniform_cell
    Division.pi = function(yc::Compartments, xc::Compartments)
                        yc[1][1] = rand(0:xc[1][1])
                        yc[1][2] = rand(0:xc[1][2])
                        yc[1][3] = xc[1][3]
                        
                        yc[2][1] = xc[1][1] - yc[1][1]
                        yc[2][2] = xc[1][2] - yc[1][2]
                        yc[2][3] = 0
                    end

    # Sim.add_transition_class(S, txn, tsl, diffProd, rnaDeg, prtDeg, diffDeg, Apoptosis, Division)
    Sim.add_transition_class(S, txn, diffProd, rnaDeg, diffDeg, Apoptosis, Division)

    return S
end

function QuorumSensing_ODEs(dM, M, parameters, t)
    c3 = parameters[:kMtxn] # kMtxn
    c1 = parameters[:kA] # kA
    c0 = parameters[:kD] # kD
    c2 = parameters[:kDD] # kDD
    c4 = parameters[:kDP] # kDP
    c6 = parameters[:kdr] # kdr
    c5 = parameters[:ktxn] # ktxn
    # Number of Compartments (N)
    dM[1] = c0*M[1]+1/2*c1*M[3]-1/2*c1*M[13]
    # N^2
