# initialize expected moments vector
function QuorumSensing_initial(N0, Mpc0, s=0)
    R0 = N0*Mpc0
    RR0 = N0*N0*Mpc0
    M = zeros(42)
    # Number of Compartments (N)
    M[1] = N0 # initial value for Moment(0, 0, 0), please specify!
    # N^2
    M[2] = ((M[1])^(2))
    # Total Mass of species 1
    M[3] = R0 # initial value for Moment(1, 0, 0), please specify!
    # M1^2
    M[4] = ((M[3])^(2))
    # Total Mass of species 2
    M[5] = 0 # initial value for Moment(0, 1, 0), please specify!
    # M2^2
    M[6] = ((M[5])^(2))
    # Total Mass of species 3
    M[7] = 0 # initial value for Moment(0, 0, 1), please specify!
    # M3^2
    M[8] = ((M[7])^(2))
    # Sum of squared content of species 1
    M[9] = 0 # initial value for Moment(1, 1, 0), please specify!
    # Sum of squared content of species 1
    M[10] = 0 # initial value for Moment(1, 0, 1), please specify!
    # Sum of squared content of species 2
    M[11] = 0 # initial value for Moment(0, 1, 1), please specify!
    # Sum of squared content of species 2
    M[12] = 0 # initial value for Moment(0, 2, 0), please specify!
    # N*M1
    M[13] = M[1]*M[3]
    # N*S2
    M[14] = M[1]*M[12]
    # M2*S1
    M[15] = M[5]*M[9]
    # N*M3
    M[16] = M[1]*M[7]
    # M3*M2
    M[17] = M[7]*M[5]
    # N*S2
    M[18] = M[1]*M[11]
    # M2*M1
    M[19] = M[5]*M[3]
    # M3*M1
    M[21] = M[7]*M[3]
    # N*S1
    M[22] = M[1]*M[10]
    # Sum of squared content of species 1
    M[23] = RR0 # initial value for Moment(2, 0, 0), please specify!
    # N*S1
    M[20] = M[1]*M[23]
    # N*S1
    M[24] = M[1]*M[9]
    # N*M2
    M[25] = M[1]*M[5]
    # M1*S1
    M[26] = M[3]*M[23]
    # M2*S1
    M[27] = M[5]*M[23]
    # S2*M1
    M[28] = M[11]*M[3]
    # M3*S1
    M[29] = M[7]*M[23]
    # M3*S1
    M[30] = M[7]*M[9]
    # S2*M1
    M[31] = M[12]*M[3]
    # S1^2
    M[32] = ((M[9])^(2))
    # M1*S1
    M[33] = M[3]*M[10]
    # S1^2
    M[34] = ((M[23])^(2))
    # M1*S1
    M[35] = M[3]*M[9]
    # M3*S1
    M[36] = M[7]*M[10]
    # S1*S1
    M[37] = M[9]*M[23]
    # S2*S1
    M[38] = M[11]*M[23]
    # M3*S2
    M[39] = M[7]*M[12]
    # S1*S1
    M[40] = M[10]*M[23]
    # M3*S2
    M[41] = M[7]*M[11]
    # S2*S1
    M[42] = M[12]*M[23]
    return M
end

##################### SAIC
@export function SAIC(;  
                            kA=10*3e-4,
                            kD=10*(π/4)*1e-3, 
                            kref=1e1, kmeas=1e-2,
                            kcomp1=5e-3, kcomp2=5e-3,
                            kact=2*1e-2, 
                            k1=2e-1, k2=1e0,
                            Ω=1.0, Ωc=1.0,
                            )
    kA, kD, kref, kmeas, kact, kcomp1, kcomp2, k1, k2, Ω, Ωc = float.(  
            (kA, kD, kref, kmeas, kact, kcomp1, kcomp2, k1, k2, Ω, Ωc) 
        )
    p = Dict(:kA=>kA, :kD=>kD, 
                :kref=>kref, :kmeas=>kmeas, 
                :kact=>kact, :kcomp1=>kcomp1, :kcomp2=>kcomp2,
                :k1=>k1, :k2=>k2,
                :Ω=>Ω, :Ωc=>Ωc,
                )
    ssaSys = getSAICSSASystem(; kA=kA, kD=kD, 
                kref=kref, kmeas=kmeas, 
                kact=kact, kcomp1=kcomp1, kcomp2=kcomp2,
                k1=k1, k2=k2,
                )
    labelsOde = [:N, :N2, :M¹⁰⁰, :M¹⁰⁰2, :M⁰¹⁰, :M⁰¹⁰2, :M⁰⁰¹, :M⁰⁰¹2, :M¹¹⁰, :M¹⁰¹, :M⁰¹¹ ]
    momentsMapping = MomentsMap(labelsOde)
    sigmaMapping = SigmaMap([:N, :M¹⁰⁰, :M⁰¹⁰, :M⁰⁰¹])
    # @show sigmaMapping #debug
    return Model(p, Ω, Ωc, SAIC_initial, SAIC_ODEs, ssaSys,
                    momentsMapping, sigmaMapping)
end

function getSAICSSASystem(;
                            kA=0, kD=0,
                            kref=0, kmeas=0, kact=0,
                            kcomp1=0, kcomp2=0,
                            k1=0, k2=0,
                            )
    S = Sim.System("SAIC", 3, # Z1, Z2, X
            [:N =>[0,0,0], # Number of compartments
             :M¹⁰⁰ =>[1,0,0], # M¹⁰⁰
             :M²⁰⁰ =>[2,0,0], # M²⁰⁰
             :M⁰¹⁰ =>[0,1,0], # M⁰¹⁰
             :M⁰²⁰ =>[0,2,0], # M⁰²⁰
             :M⁰⁰¹ =>[0,0,1], # M⁰⁰¹
             :M⁰⁰² =>[0,0,2], # M⁰⁰²
             :M¹¹⁰ =>[1,1,0], # M¹¹⁰
             :M¹⁰¹ =>[1,0,1], # M¹⁰¹
             :M⁰¹¹ =>[0,1,1], # M⁰¹¹
            ]
            )

    _mm(x,k) = x / (k + x)

    # cells' reaction network
    reference = Sim.new_chemical_reaction_class([1,0,0], kref)
    reference.H = (n::SystemState, Mom::Moments) -> 1
    reference.fast_sample_reactants! = fast_sample_uniform_cell
    # reference.g = (xc::Compartments, Mom::Moments) -> 1/Mom[1]

    measurement = Sim.new_chemical_reaction_class([0,1,0], kmeas)
    measurement.H = (n::SystemState, Mom::Moments) -> Mom[6]
    measurement.g = (xc::Compartments, Mom::Moments) -> xc[1][3]

    actuation = Sim.new_chemical_reaction_class([0,0,1], kact)
    actuation.g = (xc::Compartments, Mom::Moments) -> Mom[2]
    actuation.H = (n::SystemState, Mom::Moments) -> Mom[1]*Mom[2]

    comparison1 = Sim.new_chemical_reaction_class([-1,-1,0], kcomp1)
    comparison1.g = (xc::Compartments, Mom::Moments) -> xc[1][1]*xc[1][2]
    comparison1.H = (n::SystemState, Mom::Moments) -> Mom[8] # M¹¹⁰

    comparison2 = Sim.TransitionClass(2, 2, kcomp2)
    comparison2.g = (xc::Compartments, Mom::Moments) -> xc[1][1]*xc[2][2]
    comparison2.pi = function(yc::Compartments, xc::Compartments)
                            yc[1][:] .= xc[1][:] + [-1,0,0]
                            yc[2][:] .= xc[2][:] + [0,-1,0]
                        end   
    comparison2b = Sim.TransitionClass(2, 2, kcomp2)
    comparison2b.g = (xc::Compartments, Mom::Moments) -> xc[1][2]*xc[2][1]
    comparison2b.pi = function(yc::Compartments, xc::Compartments)
                            yc[1][:] .= xc[1][:] + [0,-1,0]
                            yc[2][:] .= xc[2][:] + [-1,0,0]
                        end   

    Apoptosis = Sim.TransitionClass(2, 1, kA) # This is a cell death
    Apoptosis.g = (xc::Compartments, Mom::Moments) -> 1
    Apoptosis.H = (n::SystemState, Mom::Moments) -> div(Mom[1]*(Mom[1]-1), 2)
    Apoptosis.pi = function(yc::Compartments, xc::Compartments)
                        yc[1][:] .= xc[1][:] + [xc[2][1],xc[2][2],0]
                    end

    Division = Sim.TransitionClass(1, 2, kD)
    Division.H = (n::SystemState, Mom::Moments) -> Mom[6]
    Division.g = (xc::Compartments, Mom::Moments) -> xc[1][3]
    Division.pi = function(yc::Compartments, xc::Compartments)
                        yc[1][1] = rand(0:xc[1][1])
                        yc[1][2] = rand(0:xc[1][2])
                        yc[1][3] = rand(0:xc[1][3])
                        
                        yc[2][1] = xc[1][1] - yc[1][1]
                        yc[2][2] = xc[1][2] - yc[1][2]
                        yc[2][3] = xc[1][3] - yc[1][3]
                    end

    productionX = Sim.new_chemical_reaction_class([0,0,1], k1)
    productionX.g = (xc::Compartments, Mom::Moments) -> 1

    degradationX = Sim.new_chemical_reaction_class([0,0,-1], k2)
    degradationX.g = (xc::Compartments, Mom::Moments) -> xc[1][3]

    Sim.add_transition_class(S, reference, measurement, actuation, 
                                comparison1, comparison2, comparison2b, 
                                Apoptosis, Division,
                                productionX, degradationX,
                                )

    return S
end

function SAIC_ODEs(dM, M, parameters, t)
    c5 = parameters[:k1] # k1
    c2 = parameters[:k2] # k2
    c3 = parameters[:kA] # kA
    c0 = parameters[:kD] # kD
    c1 = parameters[:kact] # kact
    c8 = parameters[:kcomp1] # kcomp1
    c6 = parameters[:kcomp2] # kcomp2
    c4 = parameters[:kmeas] # kmeas
    c7 = parameters[:kref] # kref
    # Number of Compartments (N)
    dM[1] = c0*M[7]+1/2*c3*M[1]-1/2*c3*M[2]
    # N^2
    dM[2] = c0*M[7]+2*c3*((M[1])^(3))+2*c0*M[13]-1/2*c3*M[1]+3/2*c3*M[2]-3*c3*M[2]*M[1]
    # Total Mass of species 1
    dM[3] = c7+1/2*c6*M[9]-c8*M[9]-1/2*c6*M[17]
    # M1^2
    dM[4] = c7+c8*M[9]+c6*M[23]+1/2*c6*M[17]-2*c8*M[23]+2*c7*M[3]-1/2*c6*M[9]-c6*M[4]*M[5]-2*c6*M[17]*M[3]+2*c6*((M[3])^(2))*M[5]
    # Total Mass of species 2
    dM[5] = c4*M[7]+1/2*c6*M[9]-c8*M[9]-1/2*c6*M[17]
    # M2^2
    dM[6] = c8*M[9]+c6*M[12]+c4*M[7]+1/2*c6*M[17]-2*c8*M[12]+2*c4*M[24]-1/2*c6*M[9]-c6*M[6]*M[3]-2*c6*M[17]*M[5]+2*c6*((M[5])^(2))*M[3]
    # Total Mass of species 3
    dM[7] = c5*M[1]+c1*M[19]+1/2*c3*M[7]-c2*M[7]-1/2*c3*M[13]
    # M3^2
